Write a Groovy program that uses a linked list data structure to implement a stack. The program should be able to perform the following stack operations: push (add an element to the top of the stack), pop (remove and return the top element from the stack), and peek (return the top element without removing it). Use object-oriented programming principles to design your implementation. You may also want to add tests to ensure the correctness of your implementation.

Solution:Here's a possible implementation of a Stack class in Groovy using a linked list data structure:

    class Stack {

        private Node head

        public void push(Object value){
            Node newNode = new Node(value)
            if (head == null) {
                head = newNode
            } else {
                newNode.next = head
                head = newNode
            }
        }

        public Object pop(){
            if (head == null) return null
            Object value = head.value
            head = head.next
            return value
        }
